import React from "react";
import { useParams } from "react-router-dom";

const Building = () => {
    const { id } = useParams();

    console.log("Building ID from URL:", id); // Debugging

    return (
        <div className="flex h-screen">
            <div className="w-1/2 bg-blue-900 text-white p-10">
                <h1 className="text-4xl font-bold">{id ? `${id} Building` : "Building Not Found"}</h1>
                <p className="text-lg mt-4">Detailed description of {id}.</p>
            </div>
            <div className="w-1/2 bg-yellow-600 p-10 flex items-center justify-center">
                <iframe
                    width="100%"
                    height="100%"
                    frameBorder="0"
                    style={{ border: 0 }}
                    src={`https://www.google.com/maps/embed/v1/place?q=${id}&key=YOUR_GOOGLE_MAPS_API_KEY`}
                    allowFullScreen
                ></iframe>
            </div>
        </div>
    );
};

export default Building;
